import React from 'react';
import { Container, Row, Col } from 'reactstrap';

import baruImage from '../../assets/images/features/feature13/baru.jpg';
import castilloImage from '../../assets/images/features/feature13/castillo.jpg';
import hiltonImage from '../../assets/images/features/feature13/hotelhilton.jpg';


const Busqueda = () => {
    return (
        <div className="busqueda" id="buscar-component" style={{ width: '100%', height: '100vh' }}>
            <div>
            <Container>
                <Row>
                    <h1 className="title1">Resultado de Busqueda</h1>
                    <Col lg="4" className="m-b-30">
                        <h4 className="card-title">Image de Playa Blancas(BARU)</h4>
                        <h6 className="card-subtitle"><code>.img-rounded</code></h6>
                        <img src={baruImage} alt="img" className="img-responsive img-rounded" width="200" />
                        <p className="m-t-15 m-b-0"></p>
                    </Col>
                    <Col lg="4" className="text-center m-b-30">
                        <h4 className="card-title">Imagen de Hotel Hilton </h4>
                        <img src={hiltonImage} alt="img" className="img-circle" width="350" />
                        <p className="m-t-15 m-b-0"></p>
                    </Col>
                    <Col lg="4">
                        <h4 className="card-title">Image Castillo San Felipe</h4>
                        <h6 className="card-subtitle"><code>img-thumbnail</code></h6>
                        <img src={castilloImage} alt="img" className="img-responsive img-thumbnail" width="200" />
                        <p className="m-t-15 m-b-0"></p>
                    </Col>
                </Row>
            </Container>

 </div>
        </div>
    );
}

export default Busqueda;
